            return (canWithdraw, withdrawTime, withdrawAmount);
        }
    }

    canWithdraw = false;
    withdrawTime = withdrawTimeStored;
    withdrawAmount = 0;
    return (canWithdraw, withdrawTime, withdrawAmount);
